import { NavLink } from "react-router-dom";
import "./Dialogs.scss"

const DialogItem=(props)=>{
  let path="/dialogs/"+props.id;
  return(
    <li> <NavLink activeClassName="activeLinkDialogs" to={path}>{props.name}</NavLink></li>
  );
}

const Dialogs=()=>{
    let DialogsData=[
      {id:1,name:"Андрей"},
      {id:2,name:"Артём"},
      {id:3,name:"Егор"},
      {id:5,name:"Вадим"},
      {id:6,name:"Ваня"},
      {id:7,name:"хз какой-то ноунейм"},
      {id:8,name:"Вадим"},
    ]

    let DialogsElements=DialogsData.map(dialog=><DialogItem name={dialog.name} id={dialog.id}></DialogItem>)

    return(<div className="Dialogs">
    <h3>Dialogs</h3>
    <ul>
    {DialogsElements}
    </ul>
    </div>
    );
}

export default Dialogs
